import React, { useState, useEffect } from "react";
import styles from "../cardHolder/cardHolder.module.css";
import axios from "axios";

//get API data for cat of the day

const GetCatPicOfTheDay = () => {
  const getCatPic = async () => {
    try {
      const response = await axios.get(`https://api.thecatapi.com/v1/images/search`);

      setCatPic(response.data);
    } catch (err) {
      // Handle Error Here
      console.error(err);
    }
  };

  const [cat, setCatPic] = useState([]);

  //Use Effect calls the get request function, hits API
  useEffect(() => {
    getCatPic();
  }, []);

  return (
    <div className={styles.kittehcards}>
      <h2 className={styles.notes}>{cat.url}</h2>
      <button className={styles.button}onClick={getCatPic}>Click for more Cat Facts!</button>
    </div>
  );
};

export default GetCatPicOfTheDay;
